import React from "react";

function Header() {
  return (
    <div className="header">
      <img
        src="https://uploads.codesandbox.io/uploads/user/4a84c0d2-c638-4b54-8b45-84ded618965f/jnWj-SC%20logo.png"
        alt="logo"
      />
      <div className="header-right">
        <h2 className="header-textalign">The Bee 42's</h2>
      </div>
    </div>
  );
}

export default Header;
